import React from 'react'


const Pagination=({totalResults})=>{
	const pageNumber=[];
	 
	console.log(totalResults)
	for(let i=1; i<= Math.ceil({totalResults} /15); i++) {
		pageNumber.push(i);
	}
	console.log(pageNumber)
	return(
		<nav>
			<ul className='pagination'>
				<p>pagination</p>

			</ul>
		</nav>
		)
}


export default Pagination;
